BEGIN TRANSACTION;
CREATE TABLE airtime_payments (
            date TEXT,
            txid TEXT PRIMARY KEY, 
            payment_amount INTEGER,
            fee INTEGER,
            new_balance INTEGER
        );
CREATE TABLE bank_transfers (
        transaction_id TEXT PRIMARY KEY, 
        date TEXT,
        amount INTEGER,
        recipient_name TEXT,
        recipient_phone TEXT,
        sender_account TEXT
    );
CREATE TABLE cash_power_bill_payments (
        transaction_id TEXT PRIMARY KEY, 
        date TEXT,
        payment_amount INTEGER,
        new_balance INTEGER,
        fee INTEGER,
        token TEXT,
        provider TEXT
    );
CREATE TABLE incoming_money (
            date TEXT,
            txid TEXT PRIMARY KEY, 
            amount_received INTEGER,
            sender TEXT ,
            new_balance INTEGER
        );
CREATE TABLE internet_voice_bundles (
        transaction_id TEXT PRIMARY KEY, 
        date TEXT,
        amount INTEGER,
        new_balance INTEGER,
        service TEXT
    );
CREATE TABLE payment_to_code_holders (
        transaction_id TEXT PRIMARY KEY, 
        date TEXT,
        amount INTEGER,
        new_balance INTEGER,
        recipient TEXT
    );
CREATE TABLE transactions_initiated_by_third_parties (
        transaction_id TEXT PRIMARY KEY, 
        external_transaction_id TEXT,
        date TEXT,
        amount INTEGER,
        sender TEXT,
        fee INTEGER,
        new_balance INTEGER
    );
CREATE TABLE transfers_to_mobile_numbers (
        id INTEGER PRIMARY KEY AUTOINCREMENT, 
        date TEXT,
        amount_transferred INTEGER,
        new_balance INTEGER,
        fee INTEGER,
        recipient TEXT,
        recipient_number TEXT
    );
CREATE TABLE withdrawals_from_agents (
        transaction_id TEXT PRIMARY KEY, 
        date TEXT,
        name TEXT,
        agent_name TEXT,
        agent_number TEXT,
        account TEXT,
        amount INTEGER,
        new_balance INTEGER,
        fee INTEGER
    );
DELETE FROM "sqlite_sequence";
COMMIT;
